import { FunctionComponent } from "react";
import Navbar from "../components/navbar";
import ProductTemplate from "../components/ProductTemplate";

// Define the type for the selectedProduct prop
type Products = {
  id: number;
  name: string;
  imageSrc: string;
  store: String,
  price: number,
  description: String
};

const Product = [
  {
    id: 1,
    name: "Product 1",
    imageSrc: "/61pbjsiyvel-12@2x.png",
    store: "Store 1",
    price: 15.99,
    description: "Description of Product 1",
  },
  {
    id: 2,
    name: 'Product 2',
    imageSrc: '/product2-image.jpg',
    store: "Store 2",
    price: 19.99,
    description: "Description of Product 2",
  },
  {
    id: 3,
    name: "Product 3",
    imageSrc: "/61pbjsiyvel-12@2x.png",
    store: "Store 1",
    price: 19.99,
    description: "Description of Product 1",
  }
];

type Desktop3Props = {
  SelectedProduct: Products; // Replace 'Product' with your actual product type
};

const Desktop3: FunctionComponent<Desktop3Props> = ({ SelectedProduct }) => {
  return (
    <div className="relative bg-white w-full h-[1024px] overflow-hidden text-left text-3xl text-darkslategray-100 font-sora">
      <div className="absolute top-[144px] left-[126px] w-[1202px] h-[863px]">
        {/* Pass the selected product to ProductTemplate */}
        <ProductTemplate product={SelectedProduct} />
      </div>
      <Navbar />
    </div>
  );
};

export default Desktop3;
